class Node:
    def __init__(self, v):
        self.val = v
        self.left = None
        self.right = None

class LList:
    def __init__(self):
        self.head = None
        self.tail = None
        self.l = 0

    def pop(self):
        node = self.head
        if node is not None:
            self.head = node.right
            self.l -= 1
        return node

    def add(self, v):
        node = Node(v)
        if self.head == None:
            self.head = node
            self.tail = node
        else:
            node.left = self.tail
            self.tail.right = node
            self.tail = node

        self.l += 1

        return node

    def remove(self, vnode):
        prevnode = vnode.left
        nextnode = vnode.right
        if prevnode is not None:
            prevnode.right = nextnode
        if nextnode is not None:
            nextnode.left = prevnode
        if self.head == vnode:
            self.head = nextnode
        if self.tail == vnode:
            self.tail = prevnode

        if vnode is not None:
            self.l -= 1


class lrucache:
    def __init__(self, k):
        self.llist = LList()
        self.pointers = {}
        self.k = k

    def insert(self, item, index):
        lastindex = -1
        # print(self.llist.l)
        if item in self.pointers:
            self.llist.remove(self.pointers[item])
        elif self.llist.l == self.k:
            node = self.llist.pop()
            # print(node.val)
            lastindex = node.val[1]
            del self.pointers[node.val[0]]

        self.pointers[item] = self.llist.add((item,index))

        return lastindex

class Solution(object):
    def lengthOfLongestSubstringKDistinct(self, s, k):
        """
        :type s: str
        :type k: int
        :rtype: int
        """

        if k == 0:
            return 0

        max = 0

        cache = lrucache(k)

        startindex = -1
        for i in range(len(s)):
            c = s[i]
            index = cache.insert(c, i)
            if index != -1:
                startindex = index

            if (i - startindex) > max:
                max = i - startindex

            # print('{0} : {1} : {2}'.format(i, startindex, max))


